import React from 'react';
import TodoListItems from './todo-list-items';

const TodoList = ( {todo} ) => {

    const element = todo.map((item) => {

        const { id, ...itemWithOutKey } = item;
        return(
            <li key ={id}> 
            <TodoListItems {...itemWithOutKey} /> 
            </li>
        )
    });

    return (
        <ul>
            { element }
        </ul>
    )
}

export default TodoList;
